import React from "react";
import '../cssPages/signin.css'


function Signin(){
    return(
        <div className="wholeSignIn">
            <p className="title">Sign in</p>
            <p>E-mail</p>
            
            <p>Password</p>
        </div>
    );
}

export default Signin;
